{'TheMusicalWorld_1843-038.txt_p27': 'Of the grand miscellaneous concert, on Tuesday evening, we have only room to say, that it took place also in the hall, and was numerously, nay, brilliantly attended. The vocalists were the Misses C. Novello, Rainforth, and Mrs. Alfred Shaw; Messrs. Braham, Phillips, Bennett, Walton, and J. Isherwood. The instrumentalists were, Messrs.', 'TheMusicalWorld_1843-038.txt_p90': 'Chorus. . (Finale, Fidelio)..the solo parts by Miss C. Novello, Miss Rainforth, Mr. Bennett, Mr. Walton, Mr. J. Isherwood, and Mr. Phillips.', 'TheMusicalWorld_1843-038.txt_p98': 'Chorus.. (Finale, Law of Java)..the solo parts by Miss C. Novello, Miss Rainforth, and Mr. Philips.'}
